import React from 'react'

import { Container } from 'reactstrap'
import logo from '../../assets/'
const Header = () => {
  return (
   <Header className="header"> 
      <Container>
          <div className='nav__wrapper'>
              <div className='logo'>

              </div>
          </div>
      </Container>
   </Header>
  )
}

export default Header;
